import React from 'react';
import {useSelector} from 'react-redux';
import { Route, Redirect } from 'react-router-dom';
import { ThemeProvider } from 'styled-components';
import {AppStyle, theme} from './styled/theme';
import Navbar from './components/navbar';
import RecentImgs from './components/recent';
import UserStory from './components/user';
import Login from './components/login';
import {AuthRoute} from './util/route';
function App() {
	const session = useSelector( 
		state => state.session,
	);
	return (
		<ThemeProvider theme={theme}>
			<AppStyle>
				<Navbar />
				<AuthRoute exact path="/" component={RecentImgs} />
				<Route exact path="/">
					{
						session.isAuthenticated ? 
							<Redirect to={'/user/' + session.id} />
							: 
							<RecentImgs />
					}
				</Route>
				<Route exact path="/login">
					{
						session.isAuthenticated ? 
							<Redirect to={'/user/' + session.id} />
							: 
							<Login />
					}
				</Route>
				<Route exact path="/signup">
					{
						session.isAuthenticated ? 
							<Redirect to={'/user/' + session.id} />
							: 
							<Signup />
					}
				</Route>
				<Route path='/user/:id' component={UserStory} />

			</AppStyle>
		</ThemeProvider>
	);
}

export default App;
